(8568, 'rqbi', 'Snap it, Sell it!', 'NGN', '5000.0000', 1, 'Taking good  product pictures should be one of the most important things you do when opening an online store or even selling on social media. To turn visitors into buyers, you need to show them how great your products are and how they help solve their problems and the best way to do that is with great pictures.\r\n\r\nGood product photography is important. It increases the perceived value of your products and makes your website or social media psge appear more trustworthy.\r\n\r\nBut what if you aren\'t a photographer and don\'t have the funds to buy huge photography equipments or to hire a pro, what do you do?\r\n\r\nThat\'s why I put together the ultimate DIY guide to beautiful  and sales worthy product photography, so that you too can shoot some really nice pictures just by using your smartphone.\r\n\r\nIn this ebook, I offer tons of tips to help you take product photos that sell. I also share step-by-step instructions to taking many product pictures.  If you follow these steps in this ebook you can pull together incredible product photos that will be ready for any eCommerce store, Amazon or eBay, jumia or konga,your website or social media page.\r\n\r\nYou will learn how to get the most out of your product photography using the tools you already have. Learn how to get the best from your phone\'s camera, how to set up product photos from scratch, lighting tips, and how to process the images in post-production.\r\n\r\n.You will also learn about some apps that can turn your smartphone into an even more powerful machine and many more tips!\r\n\r\n \r\n\r\nNeed I say more? ', '2020-09-17 06:20:48', '2021-03-10 12:21:23', NULL),
