(8613, 'j6ln', 'Michelle', 'NGN', '100.0000', 95, '<p>Good design is what makes the difference between a product that satisfies&nbsp;people’s needs and one that doesn’t. It’s the difference between a product&nbsp;that forms emotional connections with people and one that doesn’t.</p><p><br></p><p>This is why the role of a product designer cannot be over-emphasized.&nbsp;Product designers create products that meet the needs of its users through&nbsp;business strategy, user experience design, user research, data analysis, and&nbsp;user interface design.</p><p>In this book, I use my personal experience to take you through all the&nbsp;essential things you need to get you started on an exciting journey as a&nbsp;product designer who designs products that people love.</p><p>You’ll learn:</p><ul><li>How to think like the best Product Designers from around the world.</li><li>The skills you need for a Product Design career.</li><li>How to strategically level up on your skills.</li><li>How to improve yourself as a designer through others.</li><li>How to develop a meaningful relationship with a mentor.</li><li>How to launch your product design career.</li></ul><p><br></p><p>Includes 3 months learning curriculum.</p><p><br></p>', '2020-12-08 11:44:09', '2020-12-10 15:44:50', NULL),
